import React, { Fragment } from 'react'
import Carousel from '../Componentes/Carousel/Carousel'
import Container from '../Componentes/Container/Container'
import CarouseData from '../API/Carousel.json'
import Card from '../Componentes/Card/Card'
import imagedata from '../API/imageCard.json'

const Home = () => {
  return (
    <Fragment>
    <Container value='main-container'>
    <Carousel Carouselvalue={CarouseData}/>


     </Container>
     {imagedata.cardImage.map((imgkey, imgvalue)=>
      <Card key={imgvalue} values={imgkey}/>
    )}
    </Fragment>
  )
}

export default Home
